g?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\">  1、因系统原因，只能有50个车型的选择，本店补漆笔为厂家直供，专车专用颜色覆盖市场在售的98%的车型1600多种颜色，如果因为找不到车型而无法下单，请联系客服！2、补漆笔为DIY产品，操作前可将油漆涂在透明胶带上与车身对比，颜色在可接受范围内方可操作。套装施工简单方便，套装随货赠送施工流程说明。小刮小蹭买一套可用3-10次，一次购买重复使用。远离划痕。3、所有车辆经过日晒雨淋，车漆颜色产生变化，因此与产品有一定色差，这个是点缤无法解决的，因此亲要确保跟现有车漆一样颜色的补漆笔是没有的！我们珍惜每个客人够买车适产品的机会，为能解决您车居生活遇到的各种问题而感到自豪！<img data-src=\"//image.suning.cn/uimg/sop/commodity/965470304232244537842000_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/965470304232244537842000_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\">4、本产品需要学习操作使用，细微小划痕直接补漆笔点上去打磨即可，大面积可用喷灌参照视频学习操作；个人不学习自己随意动手请绕道，别买了说产品不好做差评 <img data-src=\"//image.suning.cn/uimg/sop/commodity/127171267910963727960230_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/127171267910963727960230_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/commodity/127171267910963727960230_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/127171267910963727960230_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"><img data-src=\"//image.suning.cn/uimg/sop/commodity/127171267910963727960230_x.jpg?from=mobile&amp;format=80q.webp\" alt=\"\" src=\"//image.suning.cn/uimg/sop/commodity/127171267910963727960230_x.jpg?from=mobile&format=80q.webp\" width=\"100%\" height=\"auto\"> 5、由于白色珍珠漆比较稀，原车使用三层喷涂工艺，补漆时需在喷涂白色珍珠漆前喷涂白色底漆，已达到遮盖底材作用，然后上薄薄两层白色珍珠漆即可，后喷上亮光金油效果更佳！以下车型的白色建议多购买一支白色底漆奥迪（冰川白）\\\\雪铁龙（象牙白）\\\\雪铁龙（珠光白）\\\\标致（珠光白）\\\\标致（象牙白）\\\\广州本田（珍珠白）\\\\东风本田（珍珠白）\\\\丰田（宝石白珍珠）\\\\丰田（水晶亮白珍珠)\\\\丰田(白珍珠)\\\\雷凌(珍珠白)雷克萨斯(亮白珍珠)\\\\雷克萨斯(珍珠白)\\\\雷克萨斯(083珍珠白)斯巴鲁(珍珠绸缎白)\\\\斯巴鲁(珍珠绸缎白)\\\\日产(象牙白）\\\\日产（珠光白）\\\\风神（珍珠白）\\\\一汽马自达(珠光白)\\\\一汽马自达(珍珠白)\\\\现代(水晶白)\\\\现代索(珍珠白)\\\\福特(珍珠白)\\\\起亚(珍珠白)\\\\起亚(汉玉白)\\\\铃木(珍珠白)\\\\宝马(矿石白)\\\\中华(珍珠白)\\\\东南三菱(珍珠白)\\\\长安汽车(珍珠白/雪人白)\\\\吉利全球鹰(珍珠白)\\\\吉利博瑞(冰晶白)\\\\东风风行(珍珠白)\\\\英伦(珍珠白)\\\\雷